import './App.css';
import Home from './components/Home';
import AddUser from './components/AddUser';
import AllUsers from './components/AllUsers';
import NavBar from './components/NavBar';


function App() {
  return (
    <div className='App'>
      <NavBar/>
      <Home/>
      <AllUsers/>
      <AddUser/>
    </div>
  )
}
export default App;
